import { Container, Navbar, Nav, Form, Row, Col } from 'react-bootstrap';

import { Streamer } from '../Images/Logo/streamer.svg';

export default function NavigationBar() {
    return(
        <Navbar>
            <Container>
                <Navbar.Brand href='/'>
                    <img src={Streamer} alt='Streamer+' className='logo'/>
                </Navbar.Brand>
            </Container>
        </Navbar>
    );
}
